package _2.leetcode_string;

import java.util.HashMap;
import java.util.Map;
import java.util.Objects;

/**
 * Given two strings s and t , write a function to determine if t is an anagram of s.
 * <p>
 * Example 1:
 * Input: s = "anagram", t = "nagaram" Output: true
 *
 * Example 2:
 * Input: s = "rat", t = "car" Output: false Note: You may assume the string
 * contains only lowercase alphabets.
 * <p>
 * Follow up: What if the inputs contain unicode characters? How would you adapt
 * your solution to such case?
 *
 * @author steven
 */
public class ValidAnagram {

    public static void main(String[] args) {
        ValidAnagram va = new ValidAnagram();
        String s = "";
        String t = "";
//		System.out.print(va.isAnagram(s, t));
        System.out.print(va.isAnagram2(s, t));
    }

    private boolean isAnagram(String s, String t) {
        int[] alphabet = new int[26];
        for (int i = 0; i < s.length(); i++) {
            alphabet[s.charAt(i) - 'a']++;
        }
        for (int i = 0; i < t.length(); i++) {
            alphabet[t.charAt(i) - 'a']--;
        }
        for (int i : alphabet) {
            if (i != 0) {
                return false;
            }
        }
        return true;
    }

    private boolean isAnagram2(String s, String t) {
        Map<Character, Integer> countS = new HashMap<>();
        Map<Character, Integer> countT = new HashMap<>();

        for (int i = 0; i < s.length(); i++) {
            countS.put(s.charAt(i), countS.getOrDefault(s.charAt(i), 0) + 1);
        }

        for (int i = 0; i < t.length(); i++) {
            countT.put(t.charAt(i), countT.getOrDefault(t.charAt(i), 0) + 1);
        }

        for (int i = 0; i < s.length(); i++) {
            if (!Objects.equals(countS.get(s.charAt(i)), countT.get(s.charAt(i)))) return false;
        }

        for (int i = 0; i < t.length(); i++) {
            if (!Objects.equals(countS.get(t.charAt(i)), countT.get(t.charAt(i)))) return false;
        }

        // NOTE: 不能這樣寫, 因為 != 與 == 是比較"reference",
        // Integer 是 object, 就算值一樣, 但用 == 比較就會是 false
//        for(int i = 0; i < t.length(); i++){
//            if(countT.get(t.charAt(i)) != countS.get(t.charAt(i))) {
//                return false;
//            }
//        }

        return true;

    }
}
